import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import PropTypes from 'prop-types';

const useStyles = makeStyles({
    card: {
        display: 'flex'
    },
    cardDetails: {
        flex: 1
    }
});

const PostCard = ({ post }) => {
    const classes = useStyles();
    return (
        <div>
            {post.title}
        </div>
    );
}

PostCard.propTypes = {
    post: PropTypes.object
}

export default PostCard;
